import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./App.css";

function Home() {
  return (
    <div>
      <h2>Welcome to Wilans Guitar ðŸŽ¸</h2>
      <p>Learn guitar chords and explore songs.</p>
    </div>
  );
}

function Songs() {
  return (
    <div>
      <h2>Song List ðŸŽ¶</h2>
      <p>Songs will be displayed here.</p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Wilans Guitar</h1>
          <nav className="nav-links">
            <Link to="/">Home</Link>
            <Link to="/songs">Songs</Link>
          </nav>
        </header>

        <main className="App-main">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/songs" element={<Songs />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
